import React, { Component } from "react";
import { Button, Modal, Form, input } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

export class Subscription extends Component {
  static displayName = Subscription.name;

  constructor(props) {
    super(props);
    this.state = {
      name: "",
      countProtein: "",
      countFat: "",
    };

    this.onInputChange = this.onInputChange.bind(this);
    this.sendClientData = this.sendClientData.bind(this);
  }

  onInputChange(event) {
    this.setState({
      [event.target.name]: event.target.value,
    });
  }

  render() {
    return (
      <div>
        
      </div>
    );
  }

  async sendProdData() {
    let prod = {
      Name: this.state.name,
      CountProtein: this.state.countProtein,
      CountFat: this.state.countFat,
    };
    console.log(prod);

    const reponse = await fetch(
      "https://localhost:7134/api/admin/client/create",
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(prod),
      }
    );

    const data = await reponse.json();
    console.log(data);
  }
}
